function downTab(){
	$(".tab li").click(function(){
		$(this).addClass("m-hover").siblings("li").removeClass("m-hover");
		var n = $(this).index();
		if(n==0){
			$("#interfix").show();
			$(".tab").nextAll().show();
		}
		if(n==1){
			$(".tab").nextAll().hide();
			$("#interfix").show();
		}
		if(n==2){
			$("#interfix").hide();
			$(".DContNavTab").nextAll().hide();
		}
	});
}

